  def select_BLM(self, label):
    global selected_BLM
    selected_BLM = DataFilter()._index_(label)

    settings = get_data.filterer.settings[selected_BLM]

    _translate = QtCore.QCoreApplication.translate
    self.boxOffset.setPlainText(_translate("MainWindow", str(settings["offset"])))
    self.label.setText(_translate("MainWindow", "Invert"))
    self.boxInvert.setItemText(0, _translate("MainWindow", "False"))
    self.boxInvert.setItemText(1, _translate("MainWindow", "True"))
    self.boxInvert.setCurrentIndex(int(settings["invert"]))
    self.boxAutoOffset.setPlainText(_translate("MainWindow", str(settings["auto_offset"])))
    self.boxScale.setPlainText(_translate("MainWindow", str(settings["scale"])))
    self.checkboxShown.setChecked(shown_BLMs[selected_BLM])
    self.selected_BLM_label.setText(_translate("MainWindow", f"BLM: {get_data.filterer.labels[selected_BLM].upper()}"))

  def set_value(self, element, setting):
    global selected_BLM
    if selected_BLM != None:
      value = vars(self)[element].toPlainText()
      get_data.filterer.settings[DataFilter()._index_(selected_BLM)][setting] = value

  def set_state(self, element, setting):
    global selected_BLM
    if selected_BLM != None:
      value = bool(vars(self)[element].currentIndex())
      get_data.filterer.settings[DataFilter()._index_(selected_BLM)][setting] = value

  def set_shown(self, element):
    shown_BLMs[selected_BLM] = vars(self)[element].isChecked()
    if(self.checkboxShown.isChecked() == False):
        vars(self)["led" + str(selected_BLM + 1)].setStyleSheet("background-color: rgb(128, 128, 128); border: transparent;")
    if(self.checkboxShown.isChecked()):
        vars(self)["led" + str(selected_BLM + 1)].setStyleSheet("background-color: rgb(48, 255, 44); border: transparent;")

